"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[9450],{6029:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"/2022/08/08/questions","metadata":{"permalink":"/2022/08/08/questions","source":"@site/blog/2022-08-08-questions.md","title":"PHP\u77e5\u8bc6\u70b9\u6574\u7406","description":"1. \u5982\u4f55\u907f\u514d PHP \u7cbe\u5ea6\u8ba1\u7b97\u95ee\u9898\uff1f","date":"2022-08-08T12:00:00.000Z","formattedDate":"2022\u5e748\u67088\u65e5","tags":[{"label":"interview","permalink":"/tags/interview"}],"readingTime":5.42,"truncated":true,"authors":[],"frontMatter":{"title":"PHP\u77e5\u8bc6\u70b9\u6574\u7406","date":"2022-08-08 12:00:00 +0800","tags":["interview"]},"nextItem":{"title":"\u5229\u7528WebHooks\u5b9e\u73b0\u4ee3\u7801\u81ea\u52a8\u62c9\u53d6","permalink":"/2022/02/13/git-hooks-auto-pull"}},"content":"### 1. \u5982\u4f55\u907f\u514d PHP \u7cbe\u5ea6\u8ba1\u7b97\u95ee\u9898\uff1f\\n\\n- \u91c7\u7528BC \u6570\u5b66\u51fd\u6570\uff08bcadd\u3001bcdiv\u3001bcmul\uff09\u3002\\n- \u4e58\u4ee5\u6307\u5b9a\u7684\u500d\u6570\u8f6c\u6362\u4e3a\u6574\u6570\uff0c\u518d\u8fdb\u884c\u8ba1\u7b97\u3002\\n- \u8ba1\u7b97\u65f6\u5c06\u6d6e\u70b9\u578b\u5168\u90e8\u8f6c\u4e3a\u6574\u6570\u6765\u8ba1\u7b97\uff0c\u663e\u793a\u7684\u5730\u65b9\u53ef\u4ee5\u8bbe\u7f6e\u4e3a\u5b57\u7b26\u4e32\u7c7b\u578b\u3002\\n\\n\x3c!--truncate--\x3e\\n\\n### 2. JSONP \u7684\u5b9e\u73b0\u539f\u7406\u662f\u4ec0\u4e48\uff1f\\n\\nJSONP \u662f\u4e00\u79cd\u8de8\u57df\u901a\u4fe1\u7684\u624b\u6bb5\u3002\u7c7b\u4f3c\u4e8e JSON `\u51fd\u6570\u540d({\\"data\\":\\"message\\"})`\u3002\\n\u56e0\u4e3a\u6d4f\u89c8\u5668\u7684\u540c\u6e90\u7b56\u7565\uff0c\u6d4f\u89c8\u5668\u4ece A \u7f51\u7ad9\u5411 B \u7f51\u7ad9\u8bf7\u6c42\u8d44\u6e90\uff0c\u5fc5\u987b\u540c\u65f6\u6ee1\u8db3\uff1a\\n\u534f\u8bae\u76f8\u540c\u3001\u57df\u540d\u76f8\u540c\u3001\u7aef\u53e3\u76f8\u540c\uff0c\u4efb\u4f55\u4e00\u70b9\u4e0d\u540c\u90fd\u4f1a\u4ea7\u751f\u8de8\u57df\uff0c\u4ea7\u751f\u8de8\u57df\u540e\uff0c\u6d4f\u89c8\u5668\u5c31\u4f1a\u963b\u6b62\u6570\u636e\u8fd4\u56de\u3002\\nJSONP \u5229\u7528\u4e86 `<script src=\\"\\">` \u6807\u7b7e\u53ef\u4ee5\u94fe\u63a5\u5230\u4e0d\u540c\u6e90\u7684 JS \u811a\u672c\u6587\u4ef6\uff0c\u6765\u5230\u8fbe\u8de8\u57df\u76ee\u7684\u3002\\n\\n### 3. \u9759\u6001\u8d44\u6e90\u4e3a\u4ec0\u4e48\u8981\u4f7f\u7528 CDN \u670d\u52a1\uff1f\\n\\nCDN \u53eb\u505a(Content Delivery Networks\uff0c\u901a\u5e38\u7528\u4e8e\u5206\u53d1\u9759\u6001\u8d44\u6e90)\u3002\\n\u73b0\u5728\u7684\u7f51\u7ad9\u3001APP\u5b58\u5728\u5927\u91cf\u7684\u9759\u6001\u8d44\u6e90\uff0c\u6bd4\u5982\u9ad8\u6e05\u56fe\u7247\u3001\u89c6\u9891\u3001CSS \u6837\u5f0f\u6587\u4ef6\uff0c\u8fd9\u4e9b\u6587\u4ef6\u901a\u5e38\u4e0d\u4f1a\u7ecf\u5e38\u66f4\u6539\uff0c\\n\u5229\u7528 CDN \u5c06\u8d44\u6e90\u590d\u5236\u5230\u5206\u5e03\u5728\u4e16\u754c\u5404\u5730\u7684\u8fb9\u7f18\u8282\u70b9\u7f51\u7edc\uff0c\u5f53\u7528\u6237\u8bf7\u6c42 CDN \u627f\u8f7d\u7684\u8d44\u6e90\u65f6\uff0c\u5b83\u4eec\u88ab\u8def\u7531\u5230\u79bb\u4f60\u6700\u8fd1\u7684\u8282\u70b9\u3002\\n\\n### 4. \u4e86\u89e3 JWT \u5417\uff1f\\n\\nJWT \u53eb\u505a(JSON Web Token)\uff0c\u662f\u4e3a\u4e86\u5728\u7f51\u7edc\u5e94\u7528\u73af\u5883\u95f4\u4f20\u9012\u58f0\u660e\u800c\u6267\u884c\u7684\u4e00\u79cd\u57fa\u4e8e JSON \u7684\u5f00\u653e\u6807\u51c6\uff0c\u9002\u7528\u4e8e\u5206\u5e03\u5f0f\u7ad9\u70b9\u7684\u5355\u70b9\u767b\u5f55\uff08SSO\uff09\u573a\u666f\u3002\\nJWT \u7531\u4e09\u90e8\u5206\u7ec4\u6210\uff0c\u5b83\u4eec\u4e4b\u95f4\u7528\u5706\u70b9\u8fde\u63a5: `Header\u3001Payload\u3001Signature`\u3002\\n\\n### 5. \u4fdd\u6301\u7528\u6237\u4f1a\u8bdd\u4e3a\u4ec0\u4e48\u8981\u4f7f\u7528 cookie\uff1f\u662f\u5426\u6709\u4ee3\u66ff\u65b9\u6848\uff1f\u5982\u4f55\u89e3\u51b3 session \u5171\u4eab\u95ee\u9898\uff1f\\n\\n[\u53c2\u8003\u6587](https://blog.csdn.net/Dragon_yjl/article/details/120346817)\\n\\n### 6. \u4e86\u89e3 swoole \u5417\uff1f\\n\\nSwoole \u662f\u4e00\u4e2a\u4f7f\u7528 C++ \u8bed\u8a00\u7f16\u5199\u7684\u57fa\u4e8e\u5f02\u6b65\u4e8b\u4ef6\u9a71\u52a8\u548c\u534f\u7a0b\u7684\u5e76\u884c\u7f51\u7edc\u901a\u4fe1\u5f15\u64ce\uff0c\u4e3a PHP \u63d0\u4f9b\u534f\u7a0b\u3001\u9ad8\u6027\u80fd\u7f51\u7edc\u7f16\u7a0b\u652f\u6301\u3002\u63d0\u4f9b\u4e86\u591a\u79cd\u901a\u4fe1\u534f\u8bae\u7684\u7f51\u7edc\u670d\u52a1\u5668\u548c\u5ba2\u6237\u7aef\u6a21\u5757\uff0c\u53ef\u4ee5\u65b9\u4fbf\u5feb\u901f\u7684\u5b9e\u73b0 TCP/UDP\u670d\u52a1\u3001\u9ad8\u6027\u80fdWeb\u3001WebSocket\u670d\u52a1\u3001\u7269\u8054\u7f51\u3001\u5b9e\u65f6\u901a\u8baf\u3001\u6e38\u620f\u3001\u5fae\u670d\u52a1\u7b49\uff0c\u4f7f PHP \u4e0d\u518d\u5c40\u9650\u4e8e\u4f20\u7edf\u7684 Web \u9886\u57df\u3002\\n\\n### 7. \u4e86\u89e3 docker \u5417\uff1f\\n\\nDocker \u662f\u4e00\u4e2a\u5f00\u6e90\u7684\u5e94\u7528\u5bb9\u5668\u5f15\u64ce\uff0c\u57fa\u4e8e Go \u8bed\u8a00 \u5e76\u9075\u4ece Apache2.0 \u534f\u8bae\u5f00\u6e90\u3002\\nDocker \u53ef\u4ee5\u8ba9\u5f00\u53d1\u8005\u6253\u5305\u4ed6\u4eec\u7684\u5e94\u7528\u4ee5\u53ca\u4f9d\u8d56\u5305\u5230\u4e00\u4e2a\u8f7b\u91cf\u7ea7\u3001\u53ef\u79fb\u690d\u7684\u5bb9\u5668\u4e2d\uff0c\u7136\u540e\u53d1\u5e03\u5230\u4efb\u4f55\u6d41\u884c\u7684 Linux \u673a\u5668\u4e0a\uff0c\u4e5f\u53ef\u4ee5\u5b9e\u73b0\u865a\u62df\u5316\u3002\\n\u5bb9\u5668\u662f\u5b8c\u5168\u4f7f\u7528\u6c99\u7bb1\u673a\u5236\uff0c\u76f8\u4e92\u4e4b\u95f4\u4e0d\u4f1a\u6709\u4efb\u4f55\u63a5\u53e3\uff08\u7c7b\u4f3c iPhone \u7684 app\uff09,\u66f4\u91cd\u8981\u7684\u662f\u5bb9\u5668\u6027\u80fd\u5f00\u9500\u6781\u4f4e\u3002\\n\\n### 8. \u4f7f\u7528\u8fc7\u54ea\u4e9b RPC \u534f\u8bae\uff1f\\n\\nRPC \u53eb\u505a(Remote Procedure Call \u8fdc\u7a0b\u8fc7\u7a0b\u8c03\u7528)\uff0c\u662f\u4e00\u79cd\u6280\u672f\u601d\u60f3\u800c\u975e\u4e00\u79cd\u89c4\u8303\u6216\u534f\u8bae\u3002\\n\u76f8\u6bd4\u4e8e HTTP \u534f\u8bae\uff0cRPC \u91c7\u7528\u4e8c\u8fdb\u5236\u5b57\u8282\u7801\u4f20\u8f93\uff0c\u56e0\u6b64\u66f4\u52a0\u9ad8\u6548\u548c\u5b89\u5168\u3002\\n- JSON RPC \u670d\u52a1\uff0c\u662f\u4e00\u79cd\u57fa\u4e8e JSON \u683c\u5f0f\u7684\u8f7b\u91cf\u7ea7\u7684 RPC \u534f\u8bae\u6807\u51c6\uff0c\u6613\u4e8e\u4f7f\u7528\u548c\u9605\u8bfb\u3002\\n- gRPC \u670d\u52a1\uff0cJava\u5b9e\u73b0\u7684\u5e95\u5c42\u7f51\u7edc\u5e93\u662f\u57fa\u4e8eNetty\u5f00\u53d1\u800c\u6765\uff0c\u5176Go\u5b9e\u73b0\u662f\u57fa\u4e8enet\u5e93\u3002\\n\\n### 9. MySQL \u67e5\u8be2\u4f18\u5316\u4e3e\u4f8b\\n\\n[\u53c2\u8003\u6587\u6863](https://blog.csdn.net/weixin_51689029/article/details/125316797)\\n\\n- \u907f\u514d\u5168\u8868\u626b\u63cf\uff0c\u5728 WHERE \u548c ORDER BY \u6d89\u53ca\u5230\u7684\u5217\u4e0a\u5efa\u7acb\u7d22\u5f15\u3002\\n- \u907f\u514d\u5728 WHERE \u5b50\u53e5\u4e2d\u4f7f\u7528 `!= \u548c <>`\uff0c\u5426\u5219\u5c06\u653e\u5f03\u7d22\u5f15\u800c\u8fdb\u884c\u5168\u8868\u626b\u63cf\u3002\\n- \u907f\u514d\u5728 WHERE \u5b50\u53e5\u4e2d\u5bf9\u5b57\u6bb5\u8fdb\u884c NULL \u503c\u5224\u65ad\uff0c\u5efa\u8bae\u8bbe\u7f6e\u9ed8\u8ba4\u503c\u3002\\n- \u907f\u514d\u5728 WHERE \u5b50\u53e5\u4e2d\u4f7f\u7528 OR \u6765\u8fde\u63a5\u6761\u4ef6\u3002\\n- \u907f\u514d\u4f7f\u7528 IN \u548c NOT IN\uff0c\u5bf9\u4e8e\u8fde\u7eed\u7684\u6570\u503c\u53ef\u4ee5\u91c7\u7528 BETWEEN\u3002\\n\\n### 10. \u8bf4\u4e00\u4e0b\u7f13\u5b58\u7684\u4f18\u70b9\uff0c\u9ad8\u5e76\u53d1\u8bbf\u95ee\u4e0b\u5982\u4f55\u6b63\u786e\u4f7f\u7528\u7f13\u5b58\uff1f\\n\\n[\u53c2\u8003\u6587\u6863](https://www.jianshu.com/p/20acc610fb92)\\n\\n**\u7f13\u5b58\u4f18\u70b9\uff1a**\\n- \u63d0\u9ad8\u6027\u80fd\uff1a\u7f13\u5b58\u67e5\u8be2\u901f\u5ea6\u6bd4\u6570\u636e\u5e93\u67e5\u8be2\u901f\u5ea6\u5feb\u3002\\n- \u63d0\u9ad8\u5e76\u53d1\u80fd\u529b\uff1a\u7f13\u5b58\u5206\u62c5\u4e86\u90e8\u5206\u8bf7\u6c42\uff0c\u652f\u6301\u66f4\u9ad8\u7684\u5e76\u53d1\u3002\\n\\n**\u9ad8\u5e76\u53d1\u4e0b\u7684\u4f7f\u7528\u65b9\u6cd5\uff1a**\\n- \u5728\u7f13\u5b58\u7684\u8fc7\u671f\u65f6\u95f4\u52a0\u4e0a\u4e00\u4e2a\u968f\u673a\u503c\uff0c\u907f\u514d\u7f13\u5b58\u5728\u540c\u4e00\u65f6\u95f4\u8fc7\u671f\u3002\\n- \u4f7f\u7528 Redis \u96c6\u7fa4\uff1bRedis \u6301\u4e45\u5316\u3002\\n\\n### 11. \u4f7f\u7528\u8fc7\u54ea\u4e9b\u961f\u5217\u670d\u52a1\uff0c\u7528\u5728\u4ec0\u4e48\u573a\u666f\uff1f\u9047\u5230\u8fc7\u4ec0\u4e48\u95ee\u9898\uff1f\\n\\n\u5e38\u89c1\u6d88\u606f\u961f\u5217\u670d\u52a1\uff1aRabbitMQ\u3001ActiveMQ\u3001RocketMQ\u3001Kafka\\n\u4f7f\u7528\u573a\u666f\uff1a\u5546\u54c1\u79d2\u6740\u3001\u7cfb\u7edf\u89e3\u8026(\u529f\u80fd\u8ba2\u9605/\u53d6\u6d88\u8ba2\u9605)\u3001\u65e5\u5fd7\u8bb0\u5f55"},{"id":"/2022/02/13/git-hooks-auto-pull","metadata":{"permalink":"/2022/02/13/git-hooks-auto-pull","source":"@site/blog/2022-02-13-git-hooks-auto-pull.md","title":"\u5229\u7528WebHooks\u5b9e\u73b0\u4ee3\u7801\u81ea\u52a8\u62c9\u53d6","description":"\u5176\u539f\u7406\u662f\u5229\u7528 GitLab/GitHub/YourRepository \u63d0\u4f9b\u7684 WebHooks \u94a9\u5b50\u4e8b\u4ef6\uff0c\u521b\u5efa\u4e00\u4e2a\u94a9\u5b50\u5e76\u4e14\u76d1\u542c\u5f00\u53d1\u8005\u7684 push\u4e8b\u4ef6\uff0c\u63a5\u6536\u5230push\u4e8b\u4ef6\u540e\u4f1a\u901a\u8fc7POST\u8bf7\u6c42\u5c06\u4e8b\u4ef6\u4fe1\u606f\u63a8\u9001\u5230\u6307\u5b9a\u7684URL\u3002\u5f53\u81ea\u884c\u642d\u5efa\u7684Nginx\u670d\u52a1\u5668\u63a5\u6536\u5230\u8fd9\u4e2a\u8bf7\u6c42\u540e\uff0c\u8f6c\u53d1\u5230\u81ea\u5df1\u5199\u7684 PHP\u811a\u672c\uff0cPHP\u811a\u672c\u4f1a\u505a\u4e00\u4e9b\u57fa\u7840\u6821\u9a8c\uff08\u4f8b\u5982\uff1a\u8bbf\u95ee\u4ee4\u724c\u3001\u5bc6\u7801\uff09\uff0c\u7136\u540e\u6267\u884c\u63d0\u524d\u5199\u597d\u7684 Shell \u811a\u672c\u6765\u62c9\u53d6\u4ee3\u7801\u3002","date":"2022-02-13T20:00:00.000Z","formattedDate":"2022\u5e742\u670813\u65e5","tags":[{"label":"vcs","permalink":"/tags/vcs"},{"label":"git-hooks","permalink":"/tags/git-hooks"}],"readingTime":2.285,"truncated":true,"authors":[],"frontMatter":{"title":"\u5229\u7528WebHooks\u5b9e\u73b0\u4ee3\u7801\u81ea\u52a8\u62c9\u53d6","date":"2022-02-13 20:00:00 +0800","tags":["vcs","git-hooks"]},"prevItem":{"title":"PHP\u77e5\u8bc6\u70b9\u6574\u7406","permalink":"/2022/08/08/questions"}},"content":"\u5176\u539f\u7406\u662f\u5229\u7528 `GitLab/GitHub/YourRepository` \u63d0\u4f9b\u7684 `WebHooks \u94a9\u5b50\u4e8b\u4ef6`\uff0c\u521b\u5efa\u4e00\u4e2a\u94a9\u5b50\u5e76\u4e14\u76d1\u542c\u5f00\u53d1\u8005\u7684 `push\u4e8b\u4ef6`\uff0c\u63a5\u6536\u5230push\u4e8b\u4ef6\u540e\u4f1a\u901a\u8fc7POST\u8bf7\u6c42\u5c06\u4e8b\u4ef6\u4fe1\u606f\u63a8\u9001\u5230\u6307\u5b9a\u7684URL\u3002\u5f53\u81ea\u884c\u642d\u5efa\u7684Nginx\u670d\u52a1\u5668\u63a5\u6536\u5230\u8fd9\u4e2a\u8bf7\u6c42\u540e\uff0c\u8f6c\u53d1\u5230\u81ea\u5df1\u5199\u7684 `PHP\u811a\u672c`\uff0cPHP\u811a\u672c\u4f1a\u505a\u4e00\u4e9b\u57fa\u7840\u6821\u9a8c\uff08\u4f8b\u5982\uff1a\u8bbf\u95ee\u4ee4\u724c\u3001\u5bc6\u7801\uff09\uff0c\u7136\u540e\u6267\u884c\u63d0\u524d\u5199\u597d\u7684 `Shell `\u811a\u672c\u6765\u62c9\u53d6\u4ee3\u7801\u3002\\n\\n\x3c!--truncate--\x3e\\n\\n### \u51c6\u5907\u5de5\u4f5c\\n\\n> \u9700\u8981 `Nginx + PHP 7.* + Swoole \u6269\u5c55` \u7684\u73af\u5883\u652f\u6301\\n\\n\\n\\n#### \u6dfb\u52a0\u94a9\u5b50\u8bf4\u660e\uff1a\\n\u9700\u8981\u586b\u5199\u3010URL\uff08key \u7528\u4e8e\u533a\u5206\u9879\u76ee\uff09\u3001Secret Token\u3001Trigger\u3011\\n\\n**URL\u586b\u5199\uff1a**\\n`http://test.local.com/gitlab_webhooks?key=c40d160c2ffa013b`\\n**Secret Token\u586b\u5199\uff1a**1234567890\\n**Trigger\u586b\u5199\uff1a**\u4ec5\u52fe\u9009 Push events \u5373\u53ef\\n\\n\\n```\\n\u5047\u8bbe\u9879\u76ee\u76ee\u5f55\u4e3a\uff1a\\n/home/wwwroot/test.local.com\\n/home/shells/git_pull.sh\\nNginx\u914d\u7f6e\u6587\u4ef6\uff1a\\n/usr/local/nginx/conf/vhosts/test.local.com.conf\\n\u8bbf\u95ee\u9879\u76ee\u7f51\u5740\u4e3a\uff1a\\nhttp://test.local.com\\n\u4e5f\u53ef\u76f4\u63a5\u7701\u7565 Nginx \u670d\u52a1\uff0c\u76f4\u63a5\u91c7\u7528 Swolle \u76d1\u542c HTTP\u670d\u52a1\u3002\\n\u6848\u4f8b\u56e0\u4e3a\u4f7f\u7528\u7684\u662f Docker \u5bb9\u5668\uff0c\u9879\u76ee\u5728\u5bb9\u5668\u5185\u3002\u5e76\u4e14\u53ea\u5f00\u653e\u4e8680\u7aef\u53e3\uff0c\u6240\u4ee5\u9700\u8981 Nginx \u505a\u4e00\u6b21\u8f6c\u53d1\u5de5\u4f5c\u3002\\n```\\n\\n### 1. \u4fee\u6539\u914d\u7f6e\u6587\u4ef6\uff0c\u589e\u52a0\u4ee3\u7406\u8f6c\u53d1\\n\\n`\u4ee5\u4e0b\u51e0\u6b65\u64cd\u4f5c\u90fd\u9700\u8981\u8fdb\u5165\u5230 linux \u670d\u52a1\u5668\u91cc\u9762\u8fdb\u884c\u64cd\u4f5c`\\n\\n```nginx\\nvim /usr/local/nginx/conf/vhosts/test.local.com.conf\\n# swoole \u65b9\u5f0f\\n## GitLab Webhooks \u5904\u7406\u63a8\u9001\u4e8b\u4ef6\\nlocation ^~ /gitlab_webhooks {\\n  ## \u6b64\u5904\u4f7f\u7528\u4e86 ^~ \u5339\u914d\uff0c\u6240\u4ee5\u7b26\u5408\u8fd9\u4e2a\u6761\u4ef6\u7684\uff0c\u5c06\u4e0d\u518d\u5339\u914d\u4e0b\u9762\u7684 localtion \u6bb5\\n  ## \u8f6c\u53d1\u5230\u672c\u673a 6200 \u7aef\u53e3\u7684 Swoole \u7a0b\u5e8f\u5904\u7406\\n  proxy_pass http://127.0.0.1:6200;\\n}\\n\\n## \u5728\u8fd9\u4e2a\u6307\u4ee4\u4e0a\u9762\u589e\u52a0 \u4ee3\u7406\u8f6c\u53d1\\nlocation / {}\\n\\n-----\\n\\n# php-fpm \u65b9\u5f0f\\nlocation ^~ /gitlab_webhooks {\\n    root /home/wwwroot/gitlab_webhooks;\\n    fastcgi_pass  unix:/tmp/php-cgi.sock;\\n    fastcgi_index index.php;\\n    fastcgi_param SCRIPT_FILENAME $realpath_root$fastcgi_script_name;\\n    include       fastcgi_params;\\n}\\n\\n## \u5728\u8fd9\u4e2a\u6307\u4ee4\u4e0a\u9762\u589e\u52a0 \u4ee3\u7406\u8f6c\u53d1\\nlocation / {}\\n```\\n\\n### 2. \u4e0a\u4f20\u5904\u7406\u94a9\u5b50\u7684\u4ee3\u7801\\n\\n **\u4e3b\u8981\u7684\u7a0b\u5e8f\u6587\u4ef6**\\n\\n- [WebhooksInterface.php](https://gist.github.com/helloxxb/9f6cee5abf0fa98801787b4f28e47a40)\\n- [GitPull.php](https://gist.github.com/helloxxb/6270295e556ef98cd01a4942cde07f9b)\\n- [WebhooksHttpServer.php](https://gist.github.com/helloxxb/91b2750df0f1d43aac56e4d36acdbf04)\\n\\n\\n### 3. \u542f\u52a8 Swoole \u7a0b\u5e8f\\n\\n```bash\\nphp /home/wwwroot/gitlab_webhooks/WebhooksHttpServer.php\\n\u6b64\u7a0b\u5e8f\u76d1\u542c\u7684\u662f 127.0.0.1:6200\\n```"}]}')}}]);